import { Component } from "@angular/core";
import { CTF, CtfService } from "src/app/services/ctf.service";

@Component({
  selector: "app-ctf-list",
  template: `<div class="container" style="padding-top: 65px">{{ ctfs }}</div>`,
  styles: [],
})
export class CtfListComponent {
  ctfs: CTF[] = [];

  constructor(private ctfService: CtfService) {}

  ngOnInit() {
    this.ctfService.getCTFs().subscribe((ctfs) => {
      this.ctfs = ctfs;
    });
  }
}
